import React, { Component } from 'react'
import ReactDOM from 'react-dom'

import List from './List'

const the_items = [
	{'name': 'Kevin Burgs',
	 'tagname': 'K_BurgsRulezz',
	 'message': 'I LOVE to bath in LOSER TEARS!!',
	 'location': 'Spacey, FL'
	},
	{'name': 'Mike Swanson',
	 'tagname': 'hardhittz_M',
	 'message': 'long journey ahead. Offroaders',
	 'location':'Fremont, CA'
	}
];
class Tweets extends Component {
	render () {
		return (
			<List listItems={the_items} />
		);
	}
}

export default Tweets
